import React, { Component } from 'react';
import { Link } from 'react-router-dom'

import { Container, Content, Profile } from '../Header/styled';

export default class Header extends Component {
  render() {
    return (

      <Container>
        <Content>
          <aside>
            <Profile>
              <div>
                <strong>Ramonstro</strong>
                <Link to="/Perfil">Meu Perfil</Link>
              </div>
              <img src="https://scontent-yyz1-1.cdninstagram.com/v/t51.2885-19/s150x150/105561234_2763663340529451_648574013575682897_n.jpg?_nc_ht=scontent-yyz1-1.cdninstagram.com&_nc_ohc=817qXGyce-8AX_aW2ck&oh=b83d5f1ead93dbd54aec81ac5332f1e2&oe=5F29109A" alt="Ramon" />
            </Profile>
          </aside>
        </Content>
      </Container >
    )
  }

}
